export class CadastroImovelComponent {

  primeiroGrupo = this._formBuilder.group({
    firstCtrl: ['', Validators.required],
  });
  segundoGrupo = this._formBuilder.group({
    secondCtrl: ['', Validators.required],
  });
   terceiroGrupo= this._formBuilder.group({
    secondCtrl: ['', Validators.required],
